import React from 'react';
import styled from 'styled-components';

/*
 회원 가입 또는 로그인 폼을 보여 줍니다.
*/
const AuthFormBlock = styled.div``;

const AuthForm = () => {
  return <AuthFormBlock>AuthForm</AuthFormBlock>;
};

export default AuthForm;
